
public class PattenPratice {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int arr[]= {2,4,1,5,8,1,9};
		//int brr[]= {2,4,1,5,8,9};
		
		int i,j;
		
		for(i=0;i<arr.length;i++) {
		for(j=0;j<arr.length;j++) {
			
			if(i==i+1)
				if(arr[i]==arr[j]);
			System.out.println(arr[i]);
			
		}
			
		}
		
	}

}
